    address private _owner;
    address private _type;
    address private _expired;

    constructor() {
        _owner = msg.sender;
        _type = msg.sender;
    }

    function getOwner() external view returns(address) {
        return _owner;
    }

    function getTypePermission() external returns(address) {
        return _type;
    }

    function timeExpired(uint256 _openingTime, uint256 _closingTime) public {
        require(_openingTime >= block.timestamp);
        require(_closingTime >= _openingTime);

        _openingTime = _openingTime;
        _closingTime = _closingTime;
    }
}

